  return (
    <BrowserRouter>
      <Routes>
        {/* 가장 먼저 보이게 할 라우트 */}
        <Route path="/" element={<Home/>} />

        {/* 예시: 회원가입 페이지 (필요 시 추가) */}
        {/* <Route path="/signup" element={<Signup />} /> */}
      </Routes>
    </BrowserRouter>
  );
}

